import { makeStyles } from "@mui/styles";

const ContactsStyle = makeStyles({
    ListPro: { 
        height: "50%", 
        bgcolor: "white",
        borderRadius: "1vh", 
        margin: "2vh"
    },
});

export default ContactsStyle;
